import { Link } from "react-router-dom";
import {products} from "./Utills/Custom"

function ProductsListing() {
    return ( 
        <div className="container mx-auto">
            <div>

            </div>
            <div className="grid grid-cols-4 gap-6">
                {products.map((items)=>{
                    return(
                        <div key={items.image}className="p-4 border rounded-lg bg-[#e5e7eb] shadow-xl h-50">
                           <Link to={`/product`}><img src={items.image} alt=""className="cart "/>
                            <h4>{items.name}</h4>
                            <p>Rating: {items.rating}</p>
                            <p>Price: {items.price}</p>
                            <button className="hidden cart-hover:block">Add to Cart</button></Link>
                        </div>
                    )
                })}
            </div>
        </div>
     );
}

export default ProductsListing;
